pragma solidity 0.4.24;

import "openzeppelin-solidity/contracts/lifecycle/Destructible.sol";
import "./OTH.sol";

contract Conference is Destructible {  // can be killed, so the owner gets sent the money in the end
    
    using SafeMath for uint;
    // ============
    // EVENTS:
    // ============
    
    event Register(address attendee);
    event RegisterCanceled(address attendee);
    event Refund(address _to, uint _amount); // so you can log the event
    event VoteCommitted(address indexed voter, uint numTokens);

    // ============
    // DATA STRUCTURE:
    // ============
    
    struct Attendee {
        uint _id;
        uint _availableVotingTokens;
        uint _consumedVotingTokens;
        uint _voteCount;
        uint _rewardedTokens;
    }

    struct Voucher {
        uint _id;
        string _title;
        uint _discount;
        uint _price;
        bool _active;
    }

    // ============
    // STATE VARIABLES:
    // ============

    OTH token;

    uint public startDate;
    uint public endDate;
    uint public countVotTokens;
    uint8 public voucherDiscountDecimals;

    uint public numOfAttendees;
    uint public maxNumOfAttendees;

    mapping (bytes32 => uint) public speakerVotesReceived; // maps speaker's id to vote count

    mapping(address => Attendee) public addressAttendees; // maps user's address to Attendee

    mapping(address => uint) public acquiredVouchers; //maps user's address to voucher id
    mapping(address => uint) public paidByVoucherMap; //maps user's address to amount paid by voucher
    
    mapping(uint => Voucher) public vouchers; //maps voucher's id to Voucher structure'
    uint public voucherCount;
    
    // ============
    // CONSTRUCTOR:
    // ============

    constructor(
        uint _startDate, 
        uint _endDate,
		address _tokenAddr,                 
		uint _maxNumOfAttendees, 
        uint _countVotTokens,
        uint8 _voucherDiscountDecimals
    ) 
        public
    {
        startDate = _startDate;
        endDate = _endDate;
		
        maxNumOfAttendees = _maxNumOfAttendees;
        numOfAttendees = 0;
        countVotTokens = _countVotTokens;
        voucherDiscountDecimals = _voucherDiscountDecimals;

        token = OTH(_tokenAddr);
    }

    function() payable public {}

    modifier onlyBefore(uint _time) {
        require(now < _time, "Function called too late.");
        _;
    }

    modifier onlyAfter(uint _time) {
        require(now >= _time, "Function called too early.");
        _;
    }

    function getTokenAddress() view external returns(address){
        return token;
    }

    //End the conferince. Transfer OTHs from conference to the owner
    function end() external onlyOwner onlyAfter(endDate) {
        // without this funds could be locked in the contract forever!
        withdrawTokensToOwner();
        destroy();
    }
    
    //transfer conference OTHs back to the owner
    function withdrawTokensToOwner() public payable onlyOwner{
        uint balance = token.balanceOf(address(this));
        require(token.transfer(owner, balance));
    }

    function getConferenceDetails() view external 
        returns(
            uint _startDate,
            uint _endDate,
            address _owner,
            uint _countVotTokens,
            uint _numOfAttendees,
            uint _maxNumOfAttendees,
            address _token,
            uint8 _voucherDiscountDecimals,            
            uint _voucherCount
        ){
        _startDate = startDate;
        _endDate = endDate;
        _owner = owner;
        _countVotTokens = countVotTokens;
        _numOfAttendees = numOfAttendees; 
        _maxNumOfAttendees = maxNumOfAttendees;
        _token = token;
        _voucherDiscountDecimals = voucherDiscountDecimals;
        _voucherCount = voucherCount;
    }

    //Set the budget of conference
    function getConferenceBalance() view external onlyOwner returns(uint) {
        return token.balanceOf(address(this));
    }

    //Set the max number of conference attendees
    function changeMaxNumAttendees(uint _maxNumOfAttendees) external onlyOwner onlyBefore(startDate) {
        require(numOfAttendees <= _maxNumOfAttendees, "");
        maxNumOfAttendees = _maxNumOfAttendees;
    }
	
	//Increase a voting tokens to conference attendee
    function increaseAvailableVotingTokens(address _address, uint _numTokens) external onlyOwner onlyBefore(startDate){
        Attendee storage attendee = addressAttendees[_address];
        require(attendee._id > 0, "Required valid attendee.");
        
        attendee._availableVotingTokens = attendee._availableVotingTokens.add(_numTokens);
    }
	
    function addVoucher(string title, uint discount, uint price, bool active) external onlyOwner onlyBefore(startDate) {        
        voucherCount++;
        vouchers[voucherCount] = Voucher(voucherCount, title, discount, price, active);
    }

    function changeVoucherState(uint id, bool active) external onlyOwner onlyBefore(startDate) {
        
        Voucher storage voucher = vouchers[id];
        //require a valid voucher
        require(id > 0 && id <= voucherCount);
        require(voucher._id == id, "Invalid Voucher.");
        
        voucher._active = active;        
    }
    
    //purchase conference's voucher
    function buyVoucher(uint vid) external payable onlyBefore(startDate) {
        require(owner != msg.sender, "Function called by owner");
        require(numOfAttendees < maxNumOfAttendees, "Insufficient free spots.");
        require(acquiredVouchers[msg.sender] == 0, "Require acquired only one voucher.");
        require(vid > 0 && vid <= voucherCount, "Require valid voucher.");
        require(addressAttendees[msg.sender]._id == 0, "Account already registered to the conference.");           

        Voucher storage voucher = vouchers[vid];
        require(voucher._id == vid, "Required a valid voucher.");
        require(voucher._active, "Require an active voucher.");
                
        address to = address(this);
        uint amount = voucher._price;
        require(token.transferFrom(msg.sender, to, amount));
        
        acquiredVouchers[msg.sender] = vid;
        paidByVoucherMap[msg.sender] = amount;
    }

    function register(address _attendee) external onlyOwner onlyBefore(startDate) {
        require(numOfAttendees < maxNumOfAttendees, "Insufficient free spots.");
        
        Attendee storage attendee = addressAttendees[_attendee];
        require(attendee._id == 0, "Account already registered to the conference."); 

        numOfAttendees++;
        attendee._availableVotingTokens = countVotTokens;
        attendee._id = numOfAttendees;

        emit Register(_attendee);
    }
	
    function unregister(address _attendee) external onlyOwner onlyBefore(startDate) {
        
        Attendee storage attendee = addressAttendees[_attendee];
        require(attendee._id > 0, "Require valid attendee.");

        attendee._id = 0;
        attendee._availableVotingTokens = 0;
        attendee._consumedVotingTokens = 0;
        attendee._voteCount = 0;
        attendee._rewardedTokens = 0;
        
        numOfAttendees--;
        
        emit RegisterCanceled(_attendee);       
    }

    function refund(address recipient) public payable onlyOwner onlyBefore(startDate) {
	    
	    //check if acquired voucher exists
        uint id = acquiredVouchers[recipient];
        require(id > 0, "Invalid Voucher ID.");
        
        Voucher storage voucher = vouchers[id];
        require(voucher._id == id, "Invalid Voucher.");
        
        uint amount = paidByVoucherMap[recipient];
        acquiredVouchers[recipient] = 0;
        paidByVoucherMap[recipient] = 0;
        
        require(token.transfer(recipient, amount));
        
        emit Refund(recipient, amount);
    }

    // =================
    // VOTING INTERFACE:
    // =================

    // This function increments the vote count for the specified attendee candidate.
    function voteForAttendee(address _candidate, uint _numTokens) external onlyAfter(startDate) onlyBefore(endDate) {
        require(msg.sender != _candidate, "Function called by the same address how is candidate. Cannot vote.");
        
        Attendee storage attendeeCandidate = addressAttendees[_candidate]; 
        require(attendeeCandidate._id > 0, "Required a valid candidate.");

        Attendee storage attendee = addressAttendees[msg.sender]; 
        require(attendee._id > 0, "Required a valid attendee.");
        require(attendee._availableVotingTokens >= _numTokens, "Insufficient voting tokens.");
        
        attendeeCandidate._voteCount = attendeeCandidate._voteCount.add(_numTokens);
        
        attendee._availableVotingTokens = attendee._availableVotingTokens.sub(_numTokens);
        attendee._consumedVotingTokens = attendee._consumedVotingTokens.add(_numTokens);

        emit VoteCommitted(msg.sender, _numTokens);
    }

    // This function increments the vote count for the specified Speaker candidate.
    function voteForSpeaker(bytes32 _speakerId, uint _numTokens) external onlyAfter(startDate) onlyBefore(endDate){

        require(_speakerId > 0, "Required valid speaker");

        Attendee storage attendee = addressAttendees[msg.sender]; 
        require(attendee._id > 0, "Required a valid attendee.");
        require(attendee._availableVotingTokens >= _numTokens);

        uint count = speakerVotesReceived[_speakerId];
        speakerVotesReceived[_speakerId] = count.add(_numTokens);

        attendee._availableVotingTokens = attendee._availableVotingTokens.sub(_numTokens);
        attendee._consumedVotingTokens = attendee._consumedVotingTokens.add(_numTokens);

        emit VoteCommitted(msg.sender, _numTokens);
    }

    //generating more than xUTH = 1 OTH
    function rewardByAvailableVotingTokens(address _attendee, uint _numTokens) external onlyOwner onlyAfter(startDate) {
        
        Attendee storage attendee = addressAttendees[_attendee];   
        require(attendee._id > 0, "Required a valid attendee.");
        
        if(attendee._availableVotingTokens > _numTokens)
            attendee._rewardedTokens++;
        
    }

    //consuming available voting tokens = 1 OTH
    function consumingAvailableVotingTokens(address _attendee) external onlyOwner onlyAfter(startDate) {
        Attendee storage attendee = addressAttendees[_attendee];   
        require(attendee._id > 0, "Required a valid attendee.");
        
        if(attendee._availableVotingTokens == 0)
            attendee._rewardedTokens++;
    }
}
